class Solution {
    public long minimumCost(int[] nums, int k, int dist) {
        int n = nums.length;
        long[][] dp = new long[k][n];
        for (int i = 0; i < n; i++) {
            dp[0][i] = nums[i];
        }

        for (int i = 1; i < k; i++) {
            for (int j = 0; j < n; j++) {
                dp[i][j] = Long.MAX_VALUE;
            }
            for (int j = i; j < n; j++) {
                long min = Long.MAX_VALUE;
                for (int m = j - 1; m >= 0 && (j - m) <= dist + 1; m--) {
                    min = Math.min(min, dp[i - 1][m]);
                    dp[i][j] = Math.min(dp[i][j], min + nums[j]);
                }
            }
        }

        long minCost = Long.MAX_VALUE;
        for (int i = k - 1; i < n; i++) {
            minCost = Math.min(minCost, dp[k - 1][i]);
        }

        return minCost;
    }
}
